import articles from '../data'

function Articles() {
    // console.log(articles)
    return (
        <>
        {articles.map((article)=><Article key={article.author} articleInfo={article} />)}
    
        </>
    )
}

function Article(props) {
    // console.log(props)
    return (
        <>
            <img src={props.articleInfo.urlToImage} alt="" />
        </>
    )
}

export default Articles
